<section class=""mbr-section article content14 cid-rozsZwNTay"" id=""content14-m"">



    <div class=""container"">
        <div class=""media-container-row"">
            <div class=""row col-12 col-md-12"">
                <div class=""col-12 mbr-text mbr-fonts-style col-md-4 display-7"">
                     <p class=""p-3""><strong>Запуск промо-сайта во время ЧМ-2018</strong></");
                WriteLiteral(@"p><p class=""p-3"">Производителю безалкогольных напитков требовалось в сжатые сроки запустить промо-сайт. Для этого компания использовала готовую облачную инфраструктуру BeeCLOUD, внедрение заняло всего один день. Резервные копии данных сохраняются в BeeCLOUD ежедневно — это особенно важно во время проведения маркетинговых акций. Подрядчики компании тоже получили обособленный доступ к облачным ресурсам.</p>
                </div>
                <div class=""col-12 mbr-text mbr-fonts-style display-7 col-md-4"">
                     <p class=""p-3""><strong>Поддержка инфраструктуры для роста бизнеса</strong></p><p class=""p-3"">У агентства недвижимости появилась проблема: IT-инфраструктура отставала от потребностей растущего бизнеса. Чтобы устранить этот разрыв, агентство интегрировало в свою инфраструктуру облачную платформу BeeCLOUD. Теперь компания быстро выводит на рынок краткосрочные проекты и может работать с большим объемом данных любого типа. При этом она платит только за мощности, которые использует.</p>
");
                WriteLiteral(@"                </div>
                <div class=""col-12 col-md-4 mbr-text mbr-fonts-style display-7"">
                     <p class=""p-3""><strong>Инфраструктура в соответствии с ФЗ-152</strong></p><p class=""p-3"">Производственная компания хранила IT-системы на собственной площадке. Это не соответствовало ФЗ-152, и компания перенесла базу данных и сервис обмена файлами в BeeCLOUD. Облачный ЦОД BeeCLOUD обеспечивает уровень защищенности УЗ-2 — что отвечает нормам ФЗ-152 и гарантирует безопасность персональных данных. Дополнительно компания использует выделенный доступ в сеть с шифрованием IPSec VPN.</p>
                </div>
            </div>
        </div>
    </div>
</section>

